import React from 'react';
import { Card, Container, Row, Col } from 'react-bootstrap';

const WeatherDisplay = ({ weatherData }) => {
  if (!weatherData) {
    return <div>No data available</div>;
  }

  const { name, main, weather, wind } = weatherData;

  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col md="6">
          <Card>
            <Card.Body>
              <Card.Title>Weather in {name}</Card.Title>
              <Card.Text>
                <strong>Temperature:</strong> {main.temp} Â°F<br />
                <strong>Humidity:</strong> {main.humidity} %<br />
                <strong>Condition:</strong> {weather[0].description}<br />
                <strong>Wind Speed:</strong> {wind.speed} mph
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default WeatherDisplay;
